INSERT INTO `crawl_story` VALUES (1,'webtruyen.com','http://webtruyen.com/tuy-tam-kiem/','túy tâm kiếm',' Ngọa Long Sinh','kiếm hiệp ','http://webtruyen.com/public/images/tuytamkiemXxbiiB6CVp.jpg','bạn đang đọc truyện túy tâm kiếm của tác giả ngọa long sinh trên trang đọc truyện online. trước đây năm, trang tình sử đẫm máu của võ lâm đã dẫn ghi một câu chuyện vừa thương tâm lại vừa thê thảm, khiến giới nam nhi hào kiệt mỗi khi nhớ đến phải bùi ngùi cảm động.không biết là từ đâu đến, giữa vòm trời ân oán của giang hồ bổng dưng xuất hiện một nữ nhi kiếm khách, nữ nhi mà tài nghệ cũng như sắc đẹp của nàng một phen làm điên đảo giới mày râu hào sĩ khắp trung nguyên đến miền quan ngoại .nàng đẹp, đẹp vô cùng. cái đẹp của nàng chỉ biết khen được tiếng đẹp mà không sao mô tã thành lời được. Đã thế tài hoa nàng lại xuất chúng. có thể nói bao nhiêu tinh hoa đều vun đúc vào nàng tất cả.nàng như môt đóa nam châm, đi đến đâu là xáo trộn cho địa phương ấy.những cuộc tranh chấp ngấm ngầm nhưng không kém hệ trọng. những cuộc thanh trừng đẩm máu quanh quẩn đó đây của bước chân nàng không ngoài sắc đẹp vô song ấy.bao nhiêu tay kiếm khách trẻ đẹp tình tứ cố công lặn lội theo từng bước hát hò của nàng để rồi cuối cùng cũng phải hy sinh dưới mủi kiếm nghiệt ngã của người đẹp, hoặc vì sự ghen tuông vô ý thức của đồng bọn.nhưng, tim người đâu phải gổ đá mà chẳng có lúc phải rung động.cuối cùng nàng phải ngã gọn vào tay một trang anh kiệt tài ba để rồi đem tấm thân tuyết giá trao trọn cho chàng.nhưng ai học được chử ngờ?chính kẻ đã được cái diễm phúc mà bao nhiêu người đang ao ước lại bàng quang để ruồng bỏ nàng.Đau buồn, thất vọng, nàng lang thang suốt góc bể chân trời để tìm lại hình bóng người yêu. nhưng hởi ôi, hơn nửa năm sau có kẻ đã tìm thấy thây nàng trên ngọn hợp lệ sơn nơi ngoài trường thành vạn lý, với một thanh đoản kiếm xuyên ngập vào tim. thanh kiếm ấy chinh là thanh túy tâm bảo kiếm mà nàng thường sử dụng! với chiếc bào thai còn nặng mang trên thể xác lạnh ngắt của nàng. người ta phân vân nghi hoặc không biết nàng phải chăng đã dùng thanh kiếm của mình để tự vận trong cơn đau buồn quá độ, hay bị một kẻ nào ám hại vì hận thù?lời ấy truyền đi như một tiếng sét rúng động tám phái võ lâm. tám vị chưởng mônâ vội hẹn nhau đến hợp lệ sơn và chọn ngọn bạch vân phong để xây mộ chôn nàng cùng với ngọn đoản kiếm oan nghiệt.trước phần mộ dựng một tấm bia to:“túy tâm tiên tử chi mộ”rồi bỗng dưng năm sau….',1),(2,'webtruyen.com','http://webtruyen.com/an-long-dai-hiep/','Ẩn long Đại hiệp',' Liễu Tàn Dương','kiếm hiệp ','http://webtruyen.com/public/images/anlongdaihiepzTvjH5lT2N.jpg','bạn đang đọc truyện Ẩn long Đại hiệp của tác giả liễu tàng dương trên trang đọc truyện online. mười mấy năm về trước phong dương tử xuất thân không phải là danh môn nhưng nhờ thông minh và siêng năng tập luyện võ công mà trở thành cao thủ trong võ lâm. ngoài thông minh dương tử còn có khẩu tài nên được võ lâm chọn làm minh chủ. sau một thời gian làm minh chủ, phong dương tử vì thê tử mà bỏ bê việc giang hồ. chính gì vậy mà tất cả người trong giang hồ chê trách. phong dương tử vì thanh danh minh chủ mà phải mang kiếm trở lại giang hồ để điều tra những dụ huyết án xảy ra gần đây trong võ lâm. sau một năm điều tra, phong dương tử phát thiệp võ lâm để kể rõ những vụ án mà ông đã điều tra ra cho võ lâm chính phái được biết. võ lâm đại hội vừa bắt đầu, có một thiếu phụ kề tai minh chủ nói nhỏ thì lập tức minh chủ nói một câu \"thà chết vinh còn hơn sống nhục\" rồi tự sát ngay tại chỗ. không ai biết người thiếu phụ là ai và nói những gì mà khiến minh chủ phải tự sát. cho đến thất đại môn phái cũng không hề để ý đến vụ án của minh chủ và bỏ qua suốt mười mấy năm dài.',1),(3,'webtruyen.com','http://webtruyen.com/an-cuu-ky/','Ân cừu ký',' Giả Cổ Long','kiếm hiệp ','http://webtruyen.com/public/images/ancuukyYygIlBQCmb.jpg','bạn đang đọc truyện Ân cừu ký của tác giả giả cổ long trên trang đọc truyện online. trời tối om gió lộng sóng trên mặt sông nổi cao hơn trượng ...lúc ấy đang là giờ tý bốn bờ yên lặng như tờ ....hai bên bờ sông dương tử rất nhiều bóng người lố nhố. thì ra đó là mấy trăm anh hào của hắc bạch hai đạo kể cả thủy lục hai đường và các chưởng môn đệ tử của bảy đại môn phái đương kim võ lâm đang tụ họp ở hai bên bờ sông....',1),(4,'webtruyen.com','http://webtruyen.com/am-duong-than-chuong/','Âm dương thần chưởng',' Trần Thanh Vân','kiếm hiệp ','http://webtruyen.com/public/images/amduongthanchuongGKZsJCBs9A.jpg','bạn đang đọc truyện Âm dương thần chưởng của tác giả trần thanh vân trên trang đọc truyện online. truyện xoay quanh ba nhân vật : thảo sương, hồ sơn và giang lâm.họ cùng nhau phiêu bạc giang hồ để tìm về nền võ học chí tôn, đó chính là bis kíp âm dương thần chưởng....',1),(5,'webtruyen.com','http://webtruyen.com/am-duong-tam-thu-sinh/','','','','','',0),(6,'webtruyen.com','http://webtruyen.com/anh-hung-vo-le/','','','','','',0),(7,'webtruyen.com','http://webtruyen.com/luu-quang-da-tuyet/','','','','','',0),(8,'webtruyen.com','http://webtruyen.com/bat-diet-truyen-thuyet/','','','','','',0),(9,'webtruyen.com','http://webtruyen.com/tieu-ngao-giang-ho-dai-mac-cuong-dao/','','','','','',0),(10,'webtruyen.com','http://webtruyen.com/van-nien-bat-bien-nguyet/','','','','','',0),(11,'webtruyen.com','http://webtruyen.com/on-nhu-nhat-dao/','','','','','',0),(12,'webtruyen.com','http://webtruyen.com/dai-ma-vuong/','','','','','',0),(13,'webtruyen.com','http://webtruyen.com/luc-chi-cam-ma/','','','','','',0),(14,'webtruyen.com','http://webtruyen.com/phi-dao-tuy-nguyet/','','','','','',0),(15,'webtruyen.com','http://webtruyen.com/giang-ho-ky/','','','','','',0),(16,'webtruyen.com','http://webtruyen.com/kiem-khi-truong-giang/','','','','','',0),(17,'webtruyen.com','http://webtruyen.com/duoc-ma-hoang-ha/','','','','','',0),(18,'webtruyen.com','http://webtruyen.com/giang-son-nhu-hoa/','','','','','',0),(19,'webtruyen.com','http://webtruyen.com/cat-bui-giang-ho/','','','','','',0),(20,'webtruyen.com','http://webtruyen.com/chan-kinh-cuu-cu